import { useState } from "react";

const ListTodo = () => {

    const initialList = ["Learn React", "Learn Tailwind", "Finish project"];

    const [todos, setTodos] = useState(initialList)

    return(
        <ul className="p-5">
            {todos.map((todo) =>{
                return(
                    <li>
                        <input className="mr-3" type="checkbox" id="todo1"/>
                        <label htmlFor="todo1">{todo}</label>
                    </li>
                    );
                })
            } 
        </ul>
    )
};

export default ListTodo;
